import React from 'react';
import Sidebar from './components/Sidebar';
import PostsList from './components/PostsList';

function App() {
  return (
    <main class="container m-auto">
      <div class="flex mt-12">
        <div class="w-[300px]">
          <Sidebar />
        </div>
        <PostsList />
      </div>
    </main>
  );
}

export default App;
